-- Criar o banco de dados
CREATE DATABASE bancovale;

-- criando as tabelas do bancovale

CREATE TABLE beneficiario
(beneficiarioID INTEGER PRIMARY KEY NOT NULL auto_increment, nome CHAR(255) NOT NULL, dataDeNascimento DATE NOT NULL, sexo CHAR(1) NOT NULL);

CREATE TABLE medico
(medicoID INTEGER PRIMARY KEY NOT NULL auto_increment, nome CHAR(255) NOT NULL, crm CHAR (14) NOT NULL, dataDeNascimento DATE NOT NULL);

CREATE TABLE especialidade
(especialidadeID INTEGER PRIMARY KEY NOT NULL auto_increment, especialidade VARCHAR(50) NOT NULL, cbos CHAR(10) NOT NULL);

CREATE TABLE procedimento
(procedimentoID INTEGER PRIMARY KEY NOT NULL auto_increment, descricaoProcedimento VARCHAR(255) NOT NULL, TipoDeProcedimento VARCHAR (100) NOT NULL);

CREATE TABLE localAtendimento
(localID INTEGER PRIMARY KEY NOT NULL auto_increment, endereco VARCHAR(130) NOT NULL, medicoID_F INTEGER NOT NULL, especialidadeID_F INTEGER NOT NULL);

CREATE TABLE atendimentoMedico
(beneficiarioID_F INTEGER, especialidadeID_F INTEGER, medicoID_F INTEGER, localID_F INTEGER , procedimentoID_F INTEGER, data DATE);

-- criando chaves estrangeiras

ALTER TABLE localAtendimento ADD CONSTRAINT fk_medicoID_L FOREIGN KEY(medicoID_F) REFERENCES medico (medicoID);
ALTER TABLE localAtendimento ADD CONSTRAINT fk_especialidadeID_L FOREIGN KEY(especialidadeID_F) REFERENCES especialidade (especialidadeID);

ALTER TABLE atendimentoMedico ADD CONSTRAINT fk_beneficiarioID_A FOREIGN KEY(beneficiarioID_F) REFERENCES beneficiario (beneficiarioID);
ALTER TABLE atendimentoMedico ADD CONSTRAINT fk_especialidadeID_A FOREIGN KEY(especialidadeID_F) REFERENCES especialidade (especialidadeID);
ALTER TABLE atendimentoMedico ADD CONSTRAINT fk_medicoID_A FOREIGN KEY(medicoID_F) REFERENCES medico (medicoID);
ALTER TABLE atendimentoMedico ADD CONSTRAINT fk_localID_A FOREIGN KEY(localID_F) REFERENCES localAtendimento (localID);
ALTER TABLE atendimentoMedico ADD CONSTRAINT fk_procedimentoID_A FOREIGN KEY(procedimentoID_F) REFERENCES procedimento (procedimentoID);

